import { Link } from "react-router-dom";

function EventsPage() {
  return (
    <>
      <ul>
        <li>
          <Link to="/events/event-1">Event 1</Link>
        </li>
        <li>
          <Link to="/events/event-2">Event 1</Link>
        </li>
        <li>
          <Link to="/events/event-3">Event 1</Link>
        </li>
      </ul>
    </>
  );
}

export default EventsPage;
